import { createStore } from 'redux';
import thunkMiddleware from 'redux-thunk'

import reducer from './reducers/reducer'

const store = createStore(reducer(thunkMiddleware))

const myAction = (dispatch) => {
    setTimeout(() => dispatch)
}

export default store;
